h new rule and colorMap.	This happens when #installStrikeFont:foregroundColor:backgroundColor: sets rule 37 (rgbMul).	the desired effect is to do two bitblt calls. The first one is with rule 37 and special colormap.	The second one is rule 34, with a colormap for applying the requested foreground color.	This two together do component alpha blending, i.e. alpha blend red, green and blue separatedly.	This is needed for arbitrary color over abitrary background text with subpixel AA."	| answer prevRule secondPassMap |	"If combinationRule is rgbMul, we might need the special two-pass technique for component alpha blending.	If not, do it simply"	combinationRule = 37 "rgbMul" ifFalse: [		^self basicDisplayString: aString from: startIndex to: stopIndex at: aPoint strikeFont: font kern: kernDelta ].		"We need to do a second pass. The colormap set is for use in the second pass."	secondPassMap := colorMap.	colorMap := sourceForm depth ~= destForm depth		ifTrue: [ self cachedFontColormapFrom: sourceForm depth to: destForm depth ].	answer := self basicDisplayString: aString from: startIndex to: stopIndex at: aPoint strikeFont: font kern: kernDelta.	colorMap := secondPassMap.	secondPassMap ifNotNil: [		prevRule := combinationRule.		combinationRule := 20. "rgbAdd"		self basicDisplayString: aString from: startIndex to: stopIndex at: aPoint strikeFont: font kern: kernDelta.		combinationRule := prevRule ].	^answer! !!StrikeFont class methodsFor: 'dejaVu font data' stamp: 'jmv 8/22/2009 18:49'!dejaVuSansOblique7Form	"Created using:	Clipboard default clipboardText:	 	((ByteArray streamContents:[:s|			PNGReadWriter				putForm: (Form fromFileNamed: 'AAFonts/DejaVu Sans Oblique 7.bmp')				onStream: s]) asString base64Encoded)	"	^Form fromBinaryStream: ('iVBORw0KGgoAAAANSUhEUgAABc4AAAALCAYAAABGbR6BAAA4v0lEQVR4XuV9aVBUSdpu/7p/741vbtyJrzs6ZmK6v5jp7hi7O6YXO9rWVgPZi6IgoNiLfV8EBC1kX0QQFTcUERdwA1FQwRUVAUVAEWQREUVQ2ddiKQqqnpvnnOJUFVUFaOvYPZURhNbJk2fJk/nm+zzvkh